import React, { Component } from "react";
let bgColors = {
  Default: "#81b71a",
  Blue: "#00B1E1",
  Cyan: "#37BC9B",
  Green: "#8CC152",
  Red: "#E9573F",
  Yellow: "#F6BB42"
};
class Navbar extends Component {
  render() {
    return (
      <nav
        style={{ backgroundCoolor: bgColors.Yellow }}
        className="navbar navbar-expand-sm"
      >
        <ul class="navbar-nav ">
          <li className="nav-item">MERN LOGIN SYSTEM</li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
